  `,paraId:0},{value:"dp\u6570\u7EC4\u56FE",paraId:0},{value:`/**
 * @param {number[][]} matrix
 * @return {number}
 */
var countSquares = function (matrix) {
  let count = 0;
  const m = matrix.length,
    n = matrix[0].length;
  // \u6211\u4EEC\u7528 f[i][j] \u8868\u793A\u4EE5(i, j) \u4E3A\u53F3\u4E0B\u89D2\u7684\u6B63\u65B9\u5F62\u7684\u6700\u5927\u8FB9\u957F\uFF0C
  // \u9664\u6B64\u5B9A\u4E49\u4E4B\u5916\uFF0Cf[i][j] = x \u4E5F\u8868\u793A\u4EE5(i, j) \u4E3A\u53F3\u4E0B\u89D2\u7684\u6B63\u65B9\u5F62\u7684\u6570\u76EE\u4E3A x\uFF08\u5373\u8FB9\u957F\u4E3A 1, 2, ..., x \u7684\u6B63\u65B9\u5F62\u5404\u4E00\u4E2A\uFF09\u3002
  // \u5728\u8BA1\u7B97\u51FA\u6240\u6709\u7684 f[i][j] \u540E\uFF0C\u6211\u4EEC\u5C06\u5B83\u4EEC\u8FDB\u884C\u7D2F\u52A0\uFF0C\u5C31\u53EF\u4EE5\u5F97\u5230\u77E9\u9635\u4E2D\u6B63\u65B9\u5F62\u7684\u6570\u76EE
  const dp = new Array(m).fill(0).map((_) => new Array(n).fill(0));

  for (let i = 0; i < m; i++) {
    for (let j = 0; j < n; j++) {
      if (i === 0 || j === 0) {
        dp[i][j] = matrix[i][j];
      } else if (matrix[i][j] === 0) {
        dp[i][j] = 0;
      } else {
        dp[i][j] = Math.min(dp[i - 1][j], dp[i][j - 1], dp[i - 1][j - 1]) + 1;
      }
      count += dp[i][j];
    }
  }
  return count;
};
`,paraId:0},{value:"1567.\u4E58\u79EF\u4E3A\u6B63\u6570\u7684\u6700\u957F\u5B50\u6570\u7EC4\u957F\u5EA6",paraId:0},{value:"medium",paraId:0},{value:"\u8DDF152.\u4E58\u79EF\u6700\u5927\u5B50\u6570\u7EC4 \u76F8\u4F3C",paraId:64,tocIndex:56},{value:`/**
 * @param {number[]} nums
 * @return {number}
 */
var getMaxLen = function (nums) {
  let maxLength = 0; // \u6B63\u6570\u7684\u957F\u5EA6
  let minLength = 0; // \u8D1F\u6570\u7684\u957F\u5EA6
  let res = 0;
  for (const num of nums) {
    if (num === 0) {
      // \u56E0\u4E3A\u9898\u76EE\u8981\u6C42\u8FDE\u7EED\uFF0C\u6240\u4EE5\u5F53num\u4E3A0\uFF0CmaxLength\uFF0CminLength\u90FD\u4E3A0
      maxLength = minLength = 0;
    } else if (num > 0) {
      // \u5F53 num\u4E3A\u6B63\u6570\u65F6
      maxLength = maxLength + 1;
      minLength = minLength === 0 ? 0 : minLength + 1; //\u82E5minLength\u7684\u957F\u5EA6\u4E4B\u524D\u5C31\u662F0\uFF0C\u90A3\u4E48\u8FD8\u7EE7\u7EED\u4E3A0\uFF0C\u5426\u5219+1
    } else if (num < 0) {
      let temp = maxLength; // \u4FDD\u7559\u4E4B\u524D\u7684max\uFF0C\u56E0\u4E3A\u540E\u9762\u8981\u591Amax\u8D4B\u65B0\u503C
      maxLength = minLength === 0 ? 0 : minLength + 1;
      minLength = temp + 1;
    }
    res = Math.max(res, maxLength);
  }
  return res;
};
`,paraId:0},{value:"\u5251\u6307 Offer 10- II. \u9752\u86D9\u8DF3\u53F0\u9636\u95EE\u9898",paraId:0},{value:"easy",paraId:0},{value:"\u8DDF",paraId:65,tocIndex:57},{value:"70\u9898",paraId:65,tocIndex:57},{value:"\u76F8\u540C",paraId:65,tocIndex:57},{value:`/**
 * @param {number} n
 * @return {number}
 */
var numWays = function (n) {
  const memo = new Array(n + 1).fill(0);
  const dp = (n) => {
    if (n === 0) return 1;
    if (n <= 2) return n;
    if (memo[n] > 0) return memo[n];

    memo[n] = (dp(n - 1) + dp(n - 2)) % 1000000007; // \u9632\u6B62\u6EA2\u51FA
    return memo[n];
  };

  return dp(n);
};

