\u8DDF`,paraId:6,tocIndex:13},{value:"387.\u5B57\u7B26\u4E32\u4E2D\u7684\u7B2C\u4E00\u4E2A\u552F\u4E00\u5B57\u7B26",paraId:6,tocIndex:13},{value:"\u76F8\u4F3C",paraId:6,tocIndex:13},{value:`/**
 * @param {string} s
 * @return {character}
 */
var firstUniqChar = function (s) {
    let map = new Map();
    for (const item of s) {
        if (map.has(item)) {
            // \u5DF2\u7ECF\u51FA\u73B0\u8FC7\u5C31\u7D2F\u52A0
            map.set(item, map.get(item) + 1);
        } else {
            map.set(item, 1);
        }
    }

    let res = ' ';
    for (let [key, value] of map) {
        if (value === 1) {
            return res = key
        }
    }
    return res;
};
