var singleNumber = function (nums) {
  let n = 0;
  for (let i = 0; i < nums.length; i++) {
    n ^= nums[i];
  }
  return n;
};
`,paraId:0},{value:"190.\u98A0\u5012\u4E8C\u8FDB\u5236\u4F4D",paraId:0},{value:"easy",paraId:0},{value:`/**
 * @param {number} n - a positive integer
 * @return {number} - a positive integer
 */
var reverseBits = function (n) {
  let res = 0; // 0: '0'
  // n\u4E00\u5171\u957F32\uFF0C\u6240\u4EE5\u9700\u8981\u79FB\u52A832\u6B21
  for (let i = 0; i < 32; i++) {
    // res:'00';
    res <<= 1; // \u76F8\u5F53\u4E8Eres*2
    // \u5982\u679Cn\u7684\u53F3\u8FB9\u7B2C\u4E00\u4F4D\u662F1\uFF0C\u79FB\u5165res
    // \u5982\u679C\u662F0\u4E0D\u7528\u7BA1\uFF0Cres << \u7684\u65F6\u5019\u4F1A\u7A7A\u51FA\u67650
    if (n & 1) {
      res += 1;
    }
    // 4:'100' >> '10'
    // 2:'10' >> '1'
    n >>= 1; // \u76F8\u5F53\u4E8E n/2
  }

  return res >>> 0;
};
